<h1>QUEM SOMOS</h1>
<p><h3>O que trazemos para as pessoas que nos acompanha?<h3> </p>
<P><h5> Nós trazemos todas as notícias mais atualizadas sobre o futebol mundial, ou seja, trazemos notícias sobre contratações, títulos, e jogos importantes que irão acontecer.<h5></p>

<p><h3>Como surgiu o nosso site de notícias <h3> </p>
<p><h5>Criamos nosso site através de incentivos de amigos e parentes, que virão que tinhamos potencial para entrar nesse ramo de noticiar fatos do futebol.<h5></p>

<p><h3> Com mais de 5 anos de grupo, o FUTNEWS vem sendo o maior grupo de notícias dos últimos tempos,sendo o maior grupo de notícias no ano de 2022 e 2023. O grupo é formado por dois integrantes:<h3></p>

